import React, { useState } from 'react';
import {
  Box,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TablePagination,
  Button,
  Chip,
  TextField,
  InputAdornment,
  IconButton,
  Menu,
  MenuItem,
} from '@mui/material';
import {
  Search as SearchIcon,
  MoreVert as MoreVertIcon,
  Edit as EditIcon,
  Visibility as VisibilityIcon,
  Download as DownloadIcon,
  Delete as DeleteIcon,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

interface Plan {
  id: string;
  clientName: string;
  clientId: string;
  createdAt: string;
  updatedAt: string;
  status: 'draft' | 'review' | 'approved' | 'completed';
  assignedTo: string;
  priority: 'low' | 'medium' | 'high';
}

const PlanList: React.FC = () => {
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);
  const [searchTerm, setSearchTerm] = useState('');
  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);
  const [selectedPlanId, setSelectedPlanId] = useState<string | null>(null);
  const navigate = useNavigate();

  // ダミーデータ
  const plans: Plan[] = [
    {
      id: '1',
      clientName: '田中太郎',
      clientId: 'C001',
      createdAt: '2024-01-15',
      updatedAt: '2024-01-20',
      status: 'approved',
      assignedTo: '山田相談員',
      priority: 'high',
    },
    {
      id: '2',
      clientName: '佐藤花子',
      clientId: 'C002',
      createdAt: '2024-01-14',
      updatedAt: '2024-01-19',
      status: 'review',
      assignedTo: '鈴木相談員',
      priority: 'medium',
    },
    {
      id: '3',
      clientName: '鈴木一郎',
      clientId: 'C003',
      createdAt: '2024-01-13',
      updatedAt: '2024-01-18',
      status: 'draft',
      assignedTo: '高橋相談員',
      priority: 'low',
    },
    {
      id: '4',
      clientName: '高橋美咲',
      clientId: 'C004',
      createdAt: '2024-01-12',
      updatedAt: '2024-01-17',
      status: 'completed',
      assignedTo: '田中相談員',
      priority: 'medium',
    },
  ];

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'completed':
        return 'success';
      case 'approved':
        return 'primary';
      case 'review':
        return 'warning';
      case 'draft':
        return 'default';
      default:
        return 'default';
    }
  };

  const getStatusLabel = (status: string) => {
    switch (status) {
      case 'completed':
        return '完了';
      case 'approved':
        return '承認済み';
      case 'review':
        return 'レビュー中';
      case 'draft':
        return '下書き';
      default:
        return status;
    }
  };

  const getPriorityColor = (priority: string) => {
    switch (priority) {
      case 'high':
        return 'error';
      case 'medium':
        return 'warning';
      case 'low':
        return 'success';
      default:
        return 'default';
    }
  };

  const getPriorityLabel = (priority: string) => {
    switch (priority) {
      case 'high':
        return '高';
      case 'medium':
        return '中';
      case 'low':
        return '低';
      default:
        return priority;
    }
  };

  const handleChangePage = (event: unknown, newPage: number) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event: React.ChangeEvent<HTMLInputElement>) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  const handleMenuOpen = (event: React.MouseEvent<HTMLElement>, planId: string) => {
    setAnchorEl(event.currentTarget);
    setSelectedPlanId(planId);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    setSelectedPlanId(null);
  };

  const handleView = () => {
    if (selectedPlanId) {
      navigate(`/plan/${selectedPlanId}`);
    }
    handleMenuClose();
  };

  const handleEdit = () => {
    if (selectedPlanId) {
      navigate(`/editor/${selectedPlanId}`);
    }
    handleMenuClose();
  };

  const handleDownload = () => {
    // PDFダウンロード処理
    console.log('Download plan:', selectedPlanId);
    handleMenuClose();
  };

  const handleDelete = () => {
    // 削除処理
    console.log('Delete plan:', selectedPlanId);
    handleMenuClose();
  };

  const filteredPlans = plans.filter((plan) =>
    plan.clientName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    plan.clientId.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const paginatedPlans = filteredPlans.slice(
    page * rowsPerPage,
    page * rowsPerPage + rowsPerPage
  );

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4">
          計画書一覧
        </Typography>
        <Button
          variant="contained"
          onClick={() => navigate('/upload')}
        >
          新規作成
        </Button>
      </Box>

      <Paper sx={{ p: 3 }}>
        {/* 検索バー */}
        <Box sx={{ mb: 3 }}>
          <TextField
            fullWidth
            variant="outlined"
            placeholder="利用者名またはIDで検索..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <SearchIcon />
                </InputAdornment>
              ),
            }}
          />
        </Box>

        {/* テーブル */}
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>利用者名</TableCell>
                <TableCell>利用者ID</TableCell>
                <TableCell>作成日</TableCell>
                <TableCell>更新日</TableCell>
                <TableCell>担当者</TableCell>
                <TableCell>ステータス</TableCell>
                <TableCell>優先度</TableCell>
                <TableCell align="right">操作</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {paginatedPlans.map((plan) => (
                <TableRow key={plan.id} hover>
                  <TableCell>{plan.clientName}</TableCell>
                  <TableCell>{plan.clientId}</TableCell>
                  <TableCell>{plan.createdAt}</TableCell>
                  <TableCell>{plan.updatedAt}</TableCell>
                  <TableCell>{plan.assignedTo}</TableCell>
                  <TableCell>
                    <Chip
                      label={getStatusLabel(plan.status)}
                      color={getStatusColor(plan.status) as any}
                      size="small"
                    />
                  </TableCell>
                  <TableCell>
                    <Chip
                      label={getPriorityLabel(plan.priority)}
                      color={getPriorityColor(plan.priority) as any}
                      size="small"
                    />
                  </TableCell>
                  <TableCell align="right">
                    <IconButton
                      onClick={(e) => handleMenuOpen(e, plan.id)}
                    >
                      <MoreVertIcon />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>

        {/* ページネーション */}
        <TablePagination
          rowsPerPageOptions={[5, 10, 25]}
          component="div"
          count={filteredPlans.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onPageChange={handleChangePage}
          onRowsPerPageChange={handleChangeRowsPerPage}
          labelRowsPerPage="表示件数:"
          labelDisplayedRows={({ from, to, count }) =>
            `${from}-${to} / ${count !== -1 ? count : `more than ${to}`}`
          }
        />
      </Paper>

      {/* アクションメニュー */}
      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleMenuClose}
      >
        <MenuItem onClick={handleView}>
          <VisibilityIcon sx={{ mr: 1 }} />
          詳細表示
        </MenuItem>
        <MenuItem onClick={handleEdit}>
          <EditIcon sx={{ mr: 1 }} />
          編集
        </MenuItem>
        <MenuItem onClick={handleDownload}>
          <DownloadIcon sx={{ mr: 1 }} />
          PDF出力
        </MenuItem>
        <MenuItem onClick={handleDelete} sx={{ color: 'error.main' }}>
          <DeleteIcon sx={{ mr: 1 }} />
          削除
        </MenuItem>
      </Menu>
    </Box>
  );
};

export default PlanList;
